    List<SalesReturnMasterView> articleModel;
    SalesReturnMaster view;
    string voucherNo = string.Empty;
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    long FinancialYearId;
    long UserId;
    string Email;
    string strMenu = "SalesReturn";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        Email = await sessionStorage.GetItemAsync<string>("Email");
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        UserId = await sessionStorage.GetItemAsync<long>("UserId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    protected void LoadData()
    {
        articleModel = salesRepository.SalesReturnListFill(CompanyId, FinancialYearId, voucherNo);
    }
    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                view = salesRepository.EditSalesReturnMaster(id);
                bool isSave = false;
                isSave = salesRepository.DeleteSalesReturnInvoice(id, view.VoucherNo, view.CompanyId, view.FinancialYearId);
                if (isSave == true)
                {
                    Toaster.Add("Delete Successfully.", MatToastType.Info, "SalesInvoice", null);
                    LoadData();
                    navManager.NavigateTo("inventory/salesreturnlist");
                }
                else
                {
                    Toaster.Add("Cannot be delete. already in used.", MatToastType.Warning, "SalesInvoice", null);
                    navManager.NavigateTo("inventory/salesreturnlist");
                }
            }
        }
        else
        {
            Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
            navManager.NavigateTo("dashboard");
        }
    }
    void OnPrint(ItemClickEventArgs e)
    {
        var currentRow = e.Data as SalesReturnMasterView;
        long longSalesReturnMasterId = currentRow.SalesReturnMasterId;
        JsRuntime.InvokeAsync<object>("open", new object[] { ($"/inventory/salesreturnprint/{longSalesReturnMasterId}"), "_blank" });
    }
